import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import Cards from './Cards';
import Sdata from './Sdata';
import './index.css';

function nCard(val) {
    return (
        <Cards
            sname={Sdata[0].sname}
            imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            link={Sdata[0].link}
        />
    );
}

ReactDOM.render(
    <>
        <h2 className="heading_style">My Favourite Top 5 Netflix Series</h2>

        Sdata.map(nCard);
    </>
    , document.getElementById("root")
);
